'use client'

import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { Table } from "flowbite-react";

export const Dashboard = () => {
  const [authenticated, setAuthenticated] = useState(false);

  useEffect(() => {
    const storedToken = localStorage.getItem("token");
    if (storedToken) {
      setAuthenticated(true);
    }
  }, []);

  return (
    <div className="rounded-lg p-8">
      <div className="relative overflow-x-auto">
        <h2 className="text-2xl font-bold mb-4">Trending repositories</h2>
        <Table hoverable>
          <Table.Head>
            <Table.HeadCell>Repository</Table.HeadCell>
            <Table.HeadCell>Description</Table.HeadCell>
            <Table.HeadCell>Language</Table.HeadCell>
            <Table.HeadCell>Stars</Table.HeadCell>
          </Table.Head>
          <Table.Body className="divide-y">
            <Table.Row className="bg-white dark:border-gray-700 dark:bg-gray-800">
              <Table.Cell className="whitespace-nowrap font-medium text-gray-900 dark:text-white">
                THUDM/ChatGLM3
              </Table.Cell>
              <Table.Cell>ChatGLM3 series: Open Bilingual Chat LLMs | 开源双语对话语言模型</Table.Cell>
              <Table.Cell>Python</Table.Cell>
              <Table.Cell>2.3k</Table.Cell>
            </Table.Row>
            {/* Agrega más filas aquí */}
          </Table.Body>
        </Table>
        <div className="mt-4">
          <Link to="/more" className="text-blue-500 hover:underline">See more</Link>
        </div>
      </div>
    </div>
  );
};
